import { Link } from 'react-router-dom';
import './Product.css';

function Product({id, title, price, image}) {
  return (
    <div className='product'>

          <Link to={`/product/${id}`}>
            <img src={image} alt={title} />
            <div className="product__info">
                <span>{title}</span>
                <span> ${price}</span>
            </div>
            </Link>
     </div>
  )
}

export default Product
